import React from 'react';
import NavbarAfterLogin from './NavbarAfterLogin'; // Custom navbar after login for owner
import Footer from './Footer'; // Reusing the same footer

const OwnerDashboardLayout = () => {
    return (
        <div>
            <NavbarAfterLogin />
            <div className="dashboard-content">
                {/* Your owner dashboard content here */}
                <h1>Welcome to the Owner Dashboard</h1>
            </div>
            <Footer />
        </div>
    );
};

export default OwnerDashboardLayout;
